  componentDidMount(){

   fetch('/public/api/branch2.json').then((data)=>{

    console.log(data.json())
   })

  }
  render() {
    return (
      <div className="product-list">
        <label>Search Products</label>
        <input type="text" />

        <table>
        <thead>
          <tr>
            <th>Product</th>
            <th>Revenue</th>
          </tr>
        </thead>
        <tbody>
        </tbody>
        <tfoot>
          <tr>
            <td>Total</td>
            <td></td>
          </tr>
        </tfoot>
      </table>
    </div>
  );
  }
}

export default App;
